import React from 'react';
import './index.css';
import Form from "./form/form";

class Contact extends React.Component 
{
    fetchContacts() {
        fetch(dataURL)
        .then(res => res.json())
        .then(items => {
        this.setState({
            products: items
        })
      });
    }
    render() 
    {
        return (
            <div className="main">
              <Form />
              <button className="reviews" type="button">View Reviews!</button>
            </div>
        );
    }
}

export default Contact
